`,Ee(t.p,{children:[Ee(t.strong,{children:"High-Quality Output"}),": Our model generates diverse and realistic images across a wide range of classes. Even with few-step sampling, SVG-XL produces images with remarkable fidelity and detail. Quantitative results in Table 1 and Table 2 demonstrate that SVG-XL achieves lower FID (Frchet Inception Distance) and higher Inception Scores (IS) than competitive baselines, indicating better perceptual quality and diversity."]}),`
`,Ee(t.p,{children:[Ee(t.strong,{children:"Visual Gallery"}),": Figures 2, and the supplementary figures 12 through 26 (if space permits) showcase a rich collection of SVG-XL generated samples, highlighting the model's ability to create visually compelling and diverse outputs across ImageNet 256x256."]}),`
