`,Ee(t.p,{children:"A key advantage of SVG is its ability to create a truly unified feature space, breaking the mold of task-specific representations. The SVG encoder, primarily designed for generation, seamlessly transfers to various downstream perception and understanding tasks:"}),`
`,Ee(t.p,{children:[Ee(t.strong,{children:"Strong Generalization"}),": As detailed in Table 4, the SVG encoder, without any fine-tuning of its core weights (only a lightweight linear decoder is trained), achieves comparable or even superior results to the original DINOv3 encoder on a suite of tasks including ImageNet-1K classification, ADE20K semantic segmentation, and NYUv2 depth estimation."]}),`
`,Ee(t.p,{children:[Ee(t.strong,{children:"Dual-Purpose Power"}),": This demonstrates that the SVG feature space is not only optimal for efficient and high-quality image generation but also preserves the strong discriminative and semantic capabilities of its DINOv3 foundation, establishing it as a versatile foundation for diverse visual tasks."]}),`
`,Ee(t.blockquote,{children:[`
