`,Ee(t.p,{children:[Ee(t.strong,{children:"Zero-Shot Image Editing"}),": As shown in Figure 6, SVG enables coherent zero-shot class-conditioned image editing. Following an SDEdit-style procedure, SVG generates edits that accurately align with target class semantics while preserving consistency in non-edited regions, demonstrating the inherent editability and semantic structure of its latent space."]}),`
